import React from 'react'
import MainNavigation from '../MainNavigation'

const ErrorPage = () => {
  return (
    <>
      <MainNavigation />
      <main><h1>An error occured</h1><p>Could not find the page you are looking for!</p><button onclick>Go to home</button></main>
    </>
  )
}

export default ErrorPage
